import React from 'react'
import { v4 as uuid } from 'uuid'

export const AddListButton = ( taskCardList, setTaskCardList ) => {
  const addTaskCard = () => {
    const listId = uuid();
    setTaskCardList([...taskCardList, { id: listId, draggableId: listId}]);
  };

  return (
    <div className="add-list__button__wrapper">
      <button onClick={addTaskCard} className="add-list__button">
        +
      </button>
    </div>
  )
}
